            <li>Lorem ipsum...</li>
            <li>Lorem ipsum...</li>
            <li>Lorem ipsum...</li>
          </ul>
        </nav>
        <button
          id="btn"
          class="hamburger hamburger--slider"
          type="button"
          onClick="toggle();"
        >
          <span class="hamburger-box">
            <span class="hamburger-inner"></span>
          </span>
        </button>
      </>
    );
  } else {
    return <h1>Not Set</h1>;
  }
}
